class Solution {
  public:
    // Function to return Breadth First Traversal of given graph.
    vector<int> bfsOfGraph(int V, vector<int> adj[]) {
        // Code here
        int vis[V]={0};
        vis[0]=1;
        
        vector<int> bfs;
        queue<int> q;
        q.push(0);
        while(!q.empty())
        {
            int node= q.front();
            q.pop();
            bfs.push_back(node);
            for(auto u:adj[node])
            {
                if(!vis[u])
                {
                    vis[u]=1;
                    q.push(u);
                }
            }
        }
        return bfs;
    }
};

